export default function MensagemMeta({metaZap, zaps, erros}) {
    console.log(metaZap, zaps)
    if (zaps >= metaZap && erros === 0) {
        return (
            <div className="mensagem-final">
                <h2>Segura, Hogwarts!</h2>
                <h3>O bruxão tá voando, lembrou todas e atingiu a meta!</h3>
            </div>
        )
    } else if (zaps >= metaZap && erros === 0) {
        return (
            <div className="mensagem-final">
                <h2>Ah,</h2>
                <h3>Mas ainda não atingiu seu objetivo de Zaps...</h3>
            </div>
        )
    }     
}
